import './Cards.css';
import Card from '../Card/Card';

export default function Cards({ characters, onClose }) {
   return (
      <div id='cardsContainer'>
         {characters.map(({ id, name, species, gender, image, status, origin }) => {
            return (<Card
               key={id}
               id={id}
               name={name}
               species={species}
               status={status}
               gender={gender}
               origin={origin}
               image={image}
               onClose={onClose}
            />
            );
         })}
      </div>
   );
}
